pragma solidity ^0.5.0;
import "./Ref.sol";
interface IERC20 {
    function totalSupply() external view returns (uint256);
    function balanceOf(address account) external view returns (uint256);
    function transfer(address recipient, uint256 amount) external returns (bool);
    function allowance(address owner, address spender) external view returns (uint256);
    function approve(address spender, uint256 amount) external returns (bool);
    function transferFrom(address sender, address recipient, uint256 amount) external returns (bool);
    event Transfer(address indexed from, address indexed to, uint256 value);
    event Approval(address indexed owner, address indexed spender, uint256 value);
}
pragma solidity ^0.5.0;
pragma experimental ABIEncoderV2;
contract Piswap{
    address public owner;
    constructor() public {owner = msg.sender;}
    bool hasOpentransfer;
     uint public balancepool = 330000000000;
     uint public timeendpool = 1609372742;//time end: 30/12/2020
     uint public time24h = 300;  //86400
     uint public time15day = 600; //1296000
     uint public time30day = 900;
     uint public ratiopool = balancepool / ((timeendpool - block.timestamp)/60);
     IERC20 public LQPIS = IERC20(0x08675b60387259cDcb693cebfCa1E1B334211400); //Ropsten Liquylity pool PIS
     IERC20 public PIS = IERC20(0x380B0bb1a1aC3d08DC1BE46BF6afbD42Db527252); //Ropsten Liquylity pool PIS
     mapping(address => uint) public totalstake;
    //  mapping(address => address) public sponsor;
     struct Liststake{
         string stakeID;
         address staker;
         uint amount;
         uint ratioaccount;
         uint timewithdraw;
         uint totalreward;
         uint choice; 
         bool withdrawstatus;
     } 
     Liststake[] public liststake;
     uint public totalpool24h = 0;
     uint public totalpool15day = 0;
     uint public totalpool30day = 0;
     bool public hasPool24h;
     bool public hasPool15day; 
     bool public hasPool30day; 
     uint public lasttimeStake24h;
     uint public lasttimeStake15day;
     uint public lasttimeStake30day;

     function stake(string memory stakeID, uint amount, uint choice, address contractref,address sponsor) public {
         Ref ref= Ref(contractref);
         //create ref + update balance sponsor 
         //require block.timestamp > timestake start 
        require(amount > 0, "amount cannot be 0");
        require(timeendpool > block.timestamp, "The pool is closed");
        require(choice == 1 || choice == 2 || choice == 3, "Choice not exist");
        bool hasContract;
        LQPIS.transferFrom(msg.sender, address(this), amount);
        uint timewithdraw =0;
        uint lasttimeStake =0;
        uint balancepoolstake=0;

        address sponsorref;
         if(ref.getHasrefuse(sponsor)){
             sponsorref =  sponsor;
         }else{
             sponsorref = owner;
         }
        totalstake[msg.sender] +=amount;
        // totalstake > 1 PLPIS
         if(totalstake[msg.sender] > 1){
             ref.createref(msg.sender, sponsorref);  
             ref.caculationInterest(msg.sender, amount) ;
         }

        if(choice ==1){
            hasContract = hasPool24h;
            timewithdraw = block.timestamp + time24h;
            totalpool24h +=amount;
            balancepoolstake =totalpool24h;
            lasttimeStake = lasttimeStake24h;
        }else if(choice ==2){
            hasContract = hasPool15day;
            timewithdraw = block.timestamp + time15day;
            totalpool15day +=amount;
            balancepoolstake =totalpool15day;
            lasttimeStake = lasttimeStake15day;
        }else if(choice ==3){
            hasContract = hasPool30day;
            timewithdraw = block.timestamp + time30day;
            totalpool30day +=amount;
            balancepoolstake =totalpool30day;
            lasttimeStake = lasttimeStake30day;
        }
        if(!hasContract){ 
           liststake.push(Liststake(stakeID, msg.sender, amount, ratiopool, timewithdraw, 0, choice, false)) ;
           hasContract = true;
        }else{
            for(uint i =0; i<liststake.length; i++){ 
                if(liststake[i].choice == choice && liststake[i].timewithdraw < lasttimeStake){
                    liststake[i].totalreward += liststake[i].ratioaccount * (block.timestamp - lasttimeStake)/60 ;
                    liststake[i].ratioaccount = ratiopool * liststake[i].amount / balancepoolstake;
                }                     
            }
            liststake.push(Liststake(stakeID, msg.sender, amount, amount/balancepoolstake, timewithdraw, 0, choice, false)) ;
        }
        if(choice ==1){
            lasttimeStake24h = block.timestamp;
            hasPool24h = hasContract;
        }else if(choice ==2){
            lasttimeStake15day = block.timestamp;
            hasPool15day = hasContract;
        }else if(choice ==3){
            lasttimeStake30day = block.timestamp;
            hasPool30day = hasContract;
        }

     }

     function unstake(string memory stakeID, uint choice) public{
         //70% withdraw 30% unlock before DAO:  
        uint totalwithdraw = 0;
        uint totalpool =0;
        uint totalamount = 0;
        uint totalrewardunstake = 0;
        uint lastimeunstake = 0;
        uint checkwithdraw =0;
        uint balancepoolunstake =0;
        uint totalwithfinal =0;
        if(choice ==1){
            lastimeunstake = lasttimeStake24h;
            totalpool = totalpool24h;
        }else if(choice ==2 ){
            lastimeunstake =lasttimeStake15day;
            totalpool = totalpool15day;
        }else if(choice ==3){
            lastimeunstake =lasttimeStake30day;
            totalpool = totalpool30day;
        }
        for(uint i =0; i<liststake.length; i++){
            if(keccak256(bytes(liststake[i].stakeID)) == keccak256(bytes(stakeID)) && liststake[i].staker == msg.sender && liststake[i].timewithdraw <= block.timestamp && liststake[i].choice == choice){
                totalamount = liststake[i].amount;
                totalwithdraw = liststake[i].totalreward;
                if(liststake[i].timewithdraw < lastimeunstake){
                    totalrewardunstake = totalwithdraw;
                }else{
                    totalrewardunstake = totalwithdraw + liststake[i].ratioaccount * (liststake[i].timewithdraw - lastimeunstake)/60;
                }
                totalwithfinal = 7 * totalrewardunstake / 10;
                checkwithdraw =1;
                balancepoolunstake = totalpool - totalamount;
            }
        }
        require(totalamount > 0);
        if(checkwithdraw ==1){
            for(uint i =0; i<liststake.length; i++){ 
                if(liststake[i].choice == choice && liststake[i].timewithdraw < lastimeunstake){
                    liststake[i].totalreward += liststake[i].ratioaccount * (block.timestamp - lastimeunstake)/60 ;
                    if(balancepoolunstake > 0){
                        liststake[i].ratioaccount = ratiopool * liststake[i].amount / balancepoolunstake;
                    }else{
                        liststake[i].ratioaccount = 0;
                    }
                    if(liststake[i].staker == msg.sender){
                        liststake[i].totalreward = 3 * totalrewardunstake / 10;
                        liststake[i].ratioaccount = 0;
                        liststake[i].amount =0;
                    }

                }                     
            }
            if(choice ==1){
                lasttimeStake24h = block.timestamp;
                totalpool24h = balancepoolunstake;

            }else if(choice ==2){
                lasttimeStake15day = block.timestamp;
                totalpool15day = balancepoolunstake;
            }else if(choice ==3){
                lasttimeStake30day = block.timestamp;
                totalpool30day = balancepoolunstake;
            }
            LQPIS.transfer(msg.sender,totalamount);
            PIS.transfer(msg.sender,totalwithfinal);
        }


     }

     function withdraw30(string memory stakeID) public{
        //  withdrawl all in account
        require(hasOpentransfer, "Plase wait open DAO");
        for(uint i =0; i<liststake.length; i++){ 
            if(keccak256(bytes(liststake[i].stakeID)) == keccak256(bytes(stakeID)) && liststake[i].staker == msg.sender){                
                PIS.transfer(msg.sender,liststake[i].totalreward);
            }
        }

     }

     function openWithdraw() public{
         require(msg.sender == owner, "You can't open withdraw");
         hasOpentransfer = true;
     }
     function getListstake() public view returns(Liststake[] memory){
        return liststake;
    }

    function withdrawref(address contractref) public {
        Ref ref= Ref(contractref);
        uint balanceref =0;
        if(ref.getHasrefuse(msg.sender)){
            balanceref = ref.getBalancewithdraw(msg.sender);
            if(balanceref > 0){
                PIS.transfer(msg.sender,balanceref);
                ref.resetBalance(msg.sender);
            }
        }
    }

}
